  let name = "홍길동";
  const age = 22;

  return (
    <div className="App">
      <input onChange={(e=>{name = e.target.value})}></input>
      <p>이름: {name}</p>
      <p>나이: {age}</p>
    </div>
  ); 
}

export default App;
